import http from '../http-db';

class UserDataService {

    getRecipes(data) {
        return http.get('/recipe', {data: {
            name: "marc",
            user_id: "12334"
          }});
    }
    createRecipe(data) {
        return http.post('/recipe', data)
    }
    updateRecipe(data) {
        return http.put('/recipe', data)
    }
    deleteRecipe(id, userId) {
        return http.delete(`/recipe?id=${id}`, {data: {user_id: userId}})
    }


    getCart(data) {
        return http.get('/cart', data);
    }
    createCart(data) {
        return http.post('/cart', data)
    }
    updateCart(data) {
        return http.put('/cart', data)
    }
    deleteCart(id, userId) {
        return http.delete(`/cart?id=${id}`, {data: {user_id: userId}})
    }

}

export default new UserDataService();
